from PostGISHelpers import *from WebOSM import *from region import *# Define assessment regionWustermark = Region("Wustermark",                    boundary='/Users/blubber/Documents/TEMP/wustermark_extend.shp')Wustermark_box = Region("Wustermark", boundary=(    12.871817013021891,    52.50091209200498,    13.018814242671711,    52.578008093778124))query_features = {'relation': 'brandenburg_polygon',                  'select_cols': ['osm_id', 'amenity'],                  'where_cond': "building is not NULL AND amenity is not NULL",                  'SRID': 4326}wustermark_buildings = OSMPolygons(name="Wustermark buildings", region=Wustermark)wustermark_buildings.create_where_query(features=query_features)wustermark_buildings.fetch_geoms(source_db='postgres_andi@localhost:5432/osm')wustermark_buildings.print_resultswustermark_buildings.export2shp('/Users/blubber/Documents/TEMP/blubb.shp')Brandenburg = Region()query_features = {'relation': 'brandenburg_polygon',                  'select_cols': ['osm_id', 'amenity', 'name'],                  'where_cond': "building is not NULL AND amenity is not NULL",                  'SRID': 4326}brandenburg_buildings = OSMPolygons(name="Brandenburg buildings", region=Brandenburg)brandenburg_buildings.create_where_query(features=query_features)brandenburg_buildings.fetch_geoms(source_db='postgres_andi@localhost:5432/osm')brandenburg_buildings.print_resultsbrandenburg_buildings.export2shp('/Users/blubber/Documents/TEMP/lalala.shp')